import './App.css';
import Header from './Header';
import Footer from './Footer';

function App() {
  return (
    <div className="App">
      <div className="animated-bg" aria-hidden="true"></div>

      <div className="content">
        <Header />
        {/* Horizontally scrollable cards */}
        <div className="scroll-container">
          <div className="scroll-card">
            <img src={process.env.PUBLIC_URL + '/logo192.png'} alt="Card 1" className="scroll-img" />
            <div className="scroll-text">Card 1 Description</div>
          </div>
          <div className="scroll-card">
            <img src={process.env.PUBLIC_URL + '/logo512.png'} alt="Card 2" className="scroll-img" />
            <div className="scroll-text">Card 2 Description</div>
          </div>
          <div className="scroll-card">
            <img src={process.env.PUBLIC_URL + '/favicon.ico'} alt="Card 3" className="scroll-img" />
            <div className="scroll-text">Card 3 Description</div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
